function setValue(option,type,to){
  if (option == 0){
  let times = to.split(":");
  m=times[0]
  s=times[1]
  varList[0]=m+":"+s
  update()
  return 0;
  }
  if (type==">"){
    varList[option] = to;
  }
  else if (type=="+"){
    varList[option] = (parseInt(varList[option])+parseInt(to))
  }
  else if (type=="-"){
    varList[option] = (parseInt(varList[option])-parseInt(to))
  }
  update()
};

